import React from "react";
import "./Card.scss";

const Card = props => {
  return (
        <div className="contenedor-Texto">
          <p>{props.texto}</p>
          <table>
            <thead>
              <tbody>
                {props.texto1.map(p=>{
                  return(
                    <tr>
                      <td>
                        {p.texto1}
                      </td>
                    </tr>
                  )
                })}
              </tbody>
            </thead>
            <button onClick={e=>props.addEjercicio(p.texto1)}>Guardar</button>
          </table>
        </div>
  );
};

export default Card;
